import { SimnpleButton } from ".";
import './Home.css'

const Home = () => {
    return (
        <div className="container">
            <h1>Acme Ice Cream</h1>
            <h2>Would you like a free scoop of ice cream?</h2>
            <SimnpleButton buttonTitle={"Yes"} boldTitle={true} />
        </div>
    );
}

export default Home;
